import styled from "styled-components";

const Container = styled.div``;

const ProductItem = ({ item }) => {
  return (
    <Container>
      <Image src={item.img} />
      <Stats>
        <Title>{item.title}</Title>
        <Button>SHOP NOW</Button>
      </Stats>
    </Container>
  );
};

export default ProductItem;
